import React, {Component} from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import './styles.css';
import nombreNaves from '../components/nombreNaves';

class Naves extends Component{
    state = {
    navesNombre: []
    }
    componentDidMount() {
        const {nombre} = this.props;
        const url = nombre;
        axios.get(url).then(response => response.data)
        .then((data) => {
        this.setState({ navesNombre: data })
        })
    }

    render() {
        return (
            <div className="mt-5 container">
              <div className="row">
              {this.state.navesNombre.map((data) =>(
                  <div className="elemto col-md-12 shadow p-3 mb-5 bg-white rounded animated fadeIn">
                    <div className="col-md-12">
                        <h1>
                        {data}
                        </h1>
                    </div>
                  </div>))}
              </div> 
            </div>
          );
      }
    }

    export default Naves;
